export class FooterComponent {
  autor:any = {nombre:'Wilson', apellido:'Llivicura'}
}
<footer class="rounded-top text-center" style="backgroun:#0a0a23">
    <div>
        <p>
            &copy; {{autor.nombre+" "+autor.apellido}}
        </p>
    </div>
</footer>
